import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { BrowserRouter as Router } from "react-router-dom";
import AdvocateAuth0ProviderWithHistory from "./auth0-provider-with-history-advocate";

// built using Semantic UI

ReactDOM.render(
  <AdvocateAuth0ProviderWithHistory>
    <Router>
      <App />
    </Router>
  </AdvocateAuth0ProviderWithHistory>,
  document.getElementById("root")
);
